//Importing Components from react-router
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';



//Importing other pages
import Pageclient from './components/otherpages/pageclients';
import Home from './components/otherpages/Home';
import preview_4Pilares from './components/otherpages/previewprojects/preview_4Pilares';



function App() {
  return (
    <Router>
        <Routes>
          <Route path="/" element={<Home/>} />
          <Route path="/pageclients" element={<Pageclient/>} />
          <Route></Route>
        </Routes>
    </Router>
  );
}

export default App;
